import { Dialog } from "@mui/material";

const dialogStyle = {
  // in object, styling is given in camelCase and without string
  height: "96%", // in object ; is not used
  marginTop: "12%",
  width: "60%",
  maxWidth: "100%",
  maxHeight: "100%",
  boxShadow: "none",
  overFlow: "none",
};

const LoginDialog = () => {
  return (
    <Dialog open={true} PaperProps={{ sx: dialogStyle }}>
      Hello
    </Dialog>
  );
};

export default LoginDialog;
